import React, { useState } from "react";
import Box from "./Components/Box.jsx";
import Navbar from "./Components/Navbar.jsx"

function App() {
  const raw = [
    {img: "data:image/jpeg;base64,", song: "Attention", artist: "Charlie Puth", added: false},

    {img: "data:image/jpeg;base64,", song: "Perfect", artist: "Ed Sheeran", added: false},

    {img: "data:image/jpeg;base64,", song: "Sunflower", artist: "Post Malone", added: false},

    {img: "data:image/jpeg;base64,", song: "Cupid", artist: "Fifty Fifty", added: false},

    {img: "data:image/jpeg;base64,", song: "Hosana", artist: "A.R. Rahman", added: false},
    
    {img: "data:image/jpeg;base64,", song: "Sinaithi", artist: "KNOX", added: false},
  ];

  const [data, setData] = useState(raw);
  const handleClick = (boxIndex) => {
    setData((prev) => {
      return prev.map((item,index) => {
        if(index === boxIndex) {
          return {...item, added: !item.added }
        }
        return item;
      })
    })
  }

  return (
    <>
      <div className="w-full h-screen bg-zinc-300">
          <Navbar data={data}/>

          <div className="px-14 flex justify-center items-center gap-10 mt-10 flex-wrap">
              {data.map((obj, index)=>{
                return <Box data={obj} handleClick={handleClick} key={index} index={index}/>
              })}
          </div>
      </div>
    </>
  );
};

export default App;
